	"Слепая девушка против монстров. Дивной красоты триллер-антиутопия, в котором обман подстерегает на каждом шагу": "Таинственный лес",
	"Уксбаль готовится к смерти, вспоминая прошлое и разбираясь с настоящим. Философская драма с Хавьером Бардемом": "Бьютифул",
	"Страстные и грустные истории любви жителей Парижа. Нежный киноальманах, создающий многоликий портрет города": "Париж, я люблю тебя",
	"После аварии Мия застревает между жизнью и смертью. Экранизация молодежного бестселлера с Хлоей Грейс Морец": "Если я останусь",
	"Постаревший Бальбоа натаскивает сына своего друга Аполло к бою за пояс. Майкл Б. Джордан бьется за легенду": "Крид: Наследие Рокки",
	"Друзья нашли способ видеть будущее, но предсказания пугают их все больше. Фантастический инди-триллер": "Ошибка времени",
	"За случайными свидетелями испытаний боевых роботов ведется охота. Фантастический ретробоевик из Австралии": "Боевой робот номер 4",
	"Геймдизайнер Кирилл открывает параллельные миры. Русская «Матрица» по роману Сергея Лукьяненко": "Черновик",
	"Юноша становится авиаконструктором накануне Второй мировой. Зрелый шедевр Хаяо Миядзаки о творчестве и свободе": "Ветер крепчает",
	"Убежденный холостяк влюбляется в соседку. Мелодрама по Николасу Спарксу о выборе между отношениями и свободой": "Выбор",
	"Джон Крамер давно мертв, но его дело живет. Еще больше кровавых ловушек — в продолжении культовой франшизы": "Пила 8",
	"Неверный бойфренд, плохие отметки и вездесущая мама. Ремейк французской мелодрамы о проблемах подростков": "Лето. Одноклассники. Любовь",
	"Менеджер и начинающая певица записывают альбом на улицах Нью-Йорка. Кира Найтли в фильме режиссера «Однажды»": "Хоть раз в жизни",
	"Сценарист переживает творческий кризис и сложные отношения. Звезды в завораживающей драме о поиске света": "Рыцарь кубков",
	"Рекрутер-аферист пытается украсть у топ-менеджера картину Рубенса. Триллер по мотивам детектива Ю Несбё": "Охотники за головами",
	"Друзья снимают лофт для интимных встреч и находят там труп женщины. Триллер, в котором каждый под подозрением": "Лофт",
	"Юрист-самоучка случайно попадает в амбициозную фирму. Стильное и острое производственное драмеди с Меган Маркл": "Форс-мажоры",
	"Супруги-генетики экспериментируют с ДНК и создают дочку-монстра. Местами неуютный сай-фай о родительстве": "Химера",
	"Гражданская война разделяет влюбленных. Эпическая, но тонкая драма с оскароносным перформансом Рене Зеллвегер": "Холодная гора",
	"Юная принцесса с бандой гномов восстает против мачехи. Семейная сказка с Джулией Робертс в роли злой королевы": "Белоснежка: Месть гномов",
	"Знаменитый иллюзионист пытается разоблачить аферистку-медиума. Волшебная игра Колина Фёрта и Эммы Стоун": "Магия лунного света",
	"Неудачница с вредными привычками встречает идеального парня. Ромком с Эмилией Кларк под хит Джорджа Майкла": "Рождество на двоих",
	"Подпольные концерты, наркотики и клиническая смерть в Бухаре. Трагический эпизод из жизни кумира поколений": "Высоцкий. Спасибо, что живой"
