var counter = 0;
var lastQuestionText = "";
var lastTrueAnswerText = "";
var waitNextQuestion = false;
var waitTruthAnswer = false;
var waitAnswer = false;
var checkBase = false;
var universeCategoryClickBinded = false;
var categoryClickBinded = false;
var firstAnswerText = "";
var lastAnswerText = "";
var qaStack = [];
var speedPress = 1;
var savedUniverseName = "";
var savedCategory = "";
var answers = {};
var localStorageID = "";
var questionType = "";
var maxCounter = 0;
var maxCounterStorageID = "";
var injectedCounter = false;
var universeCycled = false;
var universeHypeTrain = false;
var universeStepRunFinished = true;
var universeIndex = 0;
var started = false;
var stageQuestion = false;

const resetVars = () => {
    counter = 0;
    lastQuestionText = "";
    lastTrueAnswerText = "";
    waitNextQuestion = false;
    waitTruthAnswer = false;
    waitAnswer = false;
    checkBase = false;
    firstAnswerText = "";
    lastAnswerText = "";
    qaStack = [];
    speedPress = 1;
    savedUniverseName = "";
    savedCategory = "";
    universeCycled = false;
    universeIndex = 0;
    universeStepRunFinished = true;
    started = false;
    savedUniverseName = undefined;
};

const log = (SETTING_LOG) ? console.log : () => null;

// The wake lock sentinel.
let wakeLock = null;

// Function that attempts to request a wake lock.
const requestWakeLock = async () => {
  try {
    wakeLock = await navigator.wakeLock.request('screen');
    wakeLock.addEventListener('release', () => {
      log('Wake Lock was released');
    });
    log('Wake Lock is active');
  } catch (err) {
    console.error(`${err.name}, ${err.message}`);
  }
};

const getTime = () => {
    const date = new Date();
    return `[${date.getHours()}:${date.getMinutes()}:${date.getSeconds()}.${date.getMilliseconds()}]`;
};

const checkDataBase = data => {
    try {
        JSON.parse(data);
        return true;
    }
    catch(error) {
        localStorage.setItem(localStorageID, JSON.stringify(data));
        return false;
    }
};

const checkEmptyStorageItem = () => {
    const emptyItem = localStorage.getItem("");
   if (emptyItem) localStorage.removeItem("");
};

const uploadAnswersToLocalStorage = () => {
    for (const [category, value] of Object.entries(CATEGORIES)) {
        const localStorageID = `MEMO_${value.name}`;
        const savedRawData = localStorage.getItem(localStorageID);
        const scriptRawData = value.answers;

        checkEmptyStorageItem();

        if (!savedRawData) {
            log("NO DATA!");
            localStorage.setItem(localStorageID, scriptRawData);
            SETTING_LOG_STORAGE && log(`STORAGED "${value.name}" (${Object.keys(scriptRawData).length})`);
        } else {
            log("DATA FOUNDED");
            if (!checkDataBase(savedRawData)) {
                console.log("CORRUPTED BASE DATA");
                localStorage.setItem(localStorageID, JSON.stringify(scriptRawData));
                console.log("REUPLOADED DATA");
            } else {
                SETTING_LOG_STORAGE && log(`EXISTS DATA "${value.name}"`);
            };
        };
    };
};

const storageMaxCount = count => {
    if (count) {
        localStorage.setItem(maxCounterStorageID, count);
    } else {
        return Number(localStorage.getItem(maxCounterStorageID)) || 0;
    }
};

const loadStorage = category => {
    const categoryName = CATEGORIES[category].name;
    localStorageID = `MEMO_${categoryName}`;
    maxCounterStorageID = `MAX_COUNT_${categoryName}`;
    maxCounter = (categoryName == "UNIVERSES") ? "48-51" : storageMaxCount();
    questionType = CATEGORIES[category].type;
    log(questionType);

    const rawData = localStorage.getItem(localStorageID);

    answers = JSON.parse(rawData) || {};
    resetVars();
};
const getSavedAnswer = question => answers[question];

const recordQA = (question, answer) => {
    answers[question] = answer;
    log(`  📥 ЗАПИСЫВАЕМ "${answer}" на вопрос "${question}"`);
    storeQABase();
};

const storeQABase = () => { localStorage.setItem(localStorageID, JSON.stringify(answers)) };

const pushNext = element => {
    if (!waitNextQuestion) {
        waitNextQuestion = true;
        universeCycled = true
        log(`████████████████████████████████████\n  🏁 ОТВЕЧЕНО: ${counter} | РЕСТАРТ 🔄\n████████████████████████████████████`);
        counter = 0;
        updateCounterText(counter);

        element.click();
    };
};

const clickFirstAnswer = () => {
    setTimeout(() => {
        const firstItem = $(selector.randomanswer).first();
        const firstAnswerText = firstItem.text().trim();

        log(`  🤔 Хм..\n  🔘 Жмем на "${firstAnswerText}"`);

        waitAnswer = true;
        firstItem.click();
    }, 500);
};

const pushToStack = value => {
    qaStack.push(value);
    (qaStack.length > 2) && qaStack.shift();
};

const getFirstAnswer = () => {
    const firstItem = $(selector.randomanswer).first();
    return firstItem.text().trim();
};

const getKeyByValue = (object, value) => {
    return Object.keys(object).find(key => object[key] === value);
}

const getQuestion = type => {
    const currentQuestionText = (type == "TEXT") ? $(selector.question).text() : $(selector.image).attr("src");

    if (lastQuestionText !== currentQuestionText) {
        stageQuestion = true;
        universeCategoryClickBinded = false;
        waitNextQuestion = false;
        if (checkBase) checkBase = false;
        if (waitAnswer) {
            // сравниваем предыдущий ответ с правильным
            qaStack.map(qa => {
                const answerText = qa[lastQuestionText];
                 if (answerText) {
                     // записываем правильный ответ
                     updateCounterText(++counter);
                     log(`  🤩 [${counter}] Угадали`);
                     recordQA(lastQuestionText, answerText);
                     waitAnswer = false;
                 };
            });
        };

        const currentFirstAnswer = getFirstAnswer();
        pushToStack({ [`${currentQuestionText}`]: currentFirstAnswer });

        lastQuestionText = currentQuestionText;
        log(`🆕 ?: ${currentQuestionText}`);

        // если есть сохраненный ответ
        const savedAnswerText = getSavedAnswer(currentQuestionText);

        if (savedAnswerText && SETTING_CHECK_SAVED) {
            const foundedElements = $(`.game__test-answers-item:contains( ${savedAnswerText} )`);
            const countFoundedElements = foundedElements.length;

            if (countFoundedElements > 0) {
                let failed = 0;
                foundedElements.each(function(index) {
                    const answer = $(this);
                    const answerText = answer.text().trim();

                    if (answerText == savedAnswerText) {
                        answer.css("background-color", "rgb(91,134,10)");

                        setTimeout(() => {
                            answer.click();
                            updateCounterText(++counter);
                            log(`  🔘 [${counter}] ЗНАЮ ОТВЕТ\n    "${savedAnswerText}"`);
                            checkBase = true;
                        }, 500);

                        return false;
                    } else {
                        failed++;
                    };

                    if (failed == countFoundedElements) {
                        log(`  ❌ НЕТ СРЕДИ ВАРИАНТОВ "${savedAnswerText}"`);
                        failed = 0;
                        clickFirstAnswer();
                    };
                });
            } else clickFirstAnswer();
        } else clickFirstAnswer();
    };

    return lastQuestionText;
};

const getTruthAnswer = () => {
    const correctAnswerText = extractFirstText($(selector.modalAnswer).text());
    if (lastTrueAnswerText !== correctAnswerText) {
        lastTrueAnswerText = correctAnswerText;

        const currentQuestionText = getQuestion(questionType);

        if (waitAnswer || checkBase) {
            const savedAnswerText = getSavedAnswer(currentQuestionText);

            if (!savedAnswerText || savedAnswerText !== correctAnswerText) {
                log(`  🫠 ОТВЕТ: "${correctAnswerText}"`);

                if (!savedAnswerText) {
                    log(`  ❌ НЕ НАЙДЕН`);
                } else if (savedAnswerText !== correctAnswerText) log(`  💣💥 ОШИБКА БАЗЫ`);

                SETTING_CHECK_SAVED && recordQA(currentQuestionText, correctAnswerText);
            };

            if (checkBase) checkBase = false;
            if (waitAnswer) waitAnswer = false;

            setTimeout(() => {
                $(".modal-wrong-answer__content").children("button").click();
                log(`  ⏩ ЖМЕМ ПРОДОЛЖИТЬ ИГРУ`);
            }, 300);
        };
    };
};

var detectedCategories = false;

const detectCategory = () => {
    detectedCategories = true;

    $(".episode-card__wrapper").each(function() {
        log($(this).find(".episode-card__title").text().trim());
    });
};

const getEvents = selector => $._data($(selector).get(0), "events");

const injectCounter = () => {
    const counterElement = document.querySelector(".answers-counter");
    const injectElement = document.querySelector(".game__test-life");

    if (!counterElement && !!injectElement) {
        $(".game__test-life").after('<span class="answers-counter"></span>');
    };
};

function updateCounterText(counter) {
    if (typeof(maxCounter) == "number" && counter > maxCounter) maxCounter = counter;
    storageMaxCount(maxCounter);

    const universeInfoText = savedUniverseName ? `&nbsp; • &nbsp;🃏 ${savedUniverseName}` : "";
    $(".answers-counter").html(`${counter}&nbsp; / &nbsp;<svg class="card-answer-icon" viewBox="0 0 48 25"><use xlink:href="#kubok" /></svg>&nbsp;${maxCounter}${universeInfoText}`);
};

function renderStoragedAnswersCount() {
    $(".episode-card.episode-card_is-available").each(function() {
        const cardElement = $(this);
        const categoryName = cardElement.find(".episode-card__title").text().trim();
        const localStorageID = `MEMO_${CATEGORIES[categoryName].name}`;
        const answersRawData = localStorage.getItem(localStorageID) || 0;
        const answersCount = Object.keys(JSON.parse(answersRawData)).length;
        cardElement.find(".episode-card__points-wrapper").after(
`<div class="card-answer-count">
    <svg class="card-answer-icon" viewBox="0 0 48 25">
        <use xlink:href="#kubok" />
    </svg>
    ${answersCount}
    максимальный
</div>`);
    });
};

const pressUniverseCard = () => {
    universeIndex = 9;
    $($(".modal-multigame__game-card")[universeIndex]).click();
};

const universeHypeTrainInit = () => {
    const injectElement = document.querySelector(".modal-multigame__rules");
    const buttonElement = document.querySelector(".universe-train-button");

    if (!!injectElement && !buttonElement) {
        $(injectElement).append(`<button class="universe-train-button episode-card__btn episode-card__btn_current">Автостопом по галактике!</button>`);
        $(".universe-train-button").bind("click", function() {
            universeHypeTrain = true;
            pressUniverseCard();
        });
    };
};

const selectUniverseResult = () => {
    if (!universeStepRunFinished && stageQuestion) {
        if (stageQuestion) stageQuestion = false;
        universeStepRunFinished = true;

        if (universeCycled) {
            $("button.result__btn:contains(Выбрать вселенную)").click();
            setTimeout(() => {
                pressUniverseCard();
            }, 300);
        }

        // выходим из категории вселенных, если прошлись по всем
        if (!universeCycled && (universeIndex == UNIVERSE_MAX_INDEX)) {
            universeHypeTrain = false;
            $("button.result__btn.result__btn_gray:contains(На главную)").click();
        };

        if (universeHypeTrain) {
            universeIndex++;
            $("button.result__btn:contains(Выбрать вселенную)").click();
            setTimeout(() => {
                pressUniverseCard();
            }, 300);
        };
    };
};

const getUniverseIndexByName = name => {
    let result;
    $(".modal-multigame__game-card").each(function(index) {
        const indexName = $(this).find(".modal-multigame__game-card-title").text().trim();
        if (indexName == name) {
            result = index;
            return;
        };
    });
    return result;
};

var onMutate = function(mutationsList) {
    mutationsList.forEach(mutation => {
        // скипаем модалку с условиями
        if (document.querySelector(selector.start)) {
            if (!started) {
                started = true;
                $(selector.start).click();
            };
        };

        // ждем появления вопроса
        if (document.querySelector(selector.question) || document.querySelector(selector.image)) {
            getQuestion(questionType);

            injectCounter();
        };

        // ждем правильный ответ
        if (document.querySelector(selector.modalAnswer)) {
            getTruthAnswer();
        };

        // биндим обработчик на категорию
        if (document.querySelector(selector.categoryCard)) {
            const events = getEvents(".episode-card.episode-card_is-available");
            if (!events) {
                renderStoragedAnswersCount();

                $(".episode-card.episode-card_is-available").bind("click", function(){
                    savedCategory = $(this).find(".episode-card__title").text().trim();
                    loadStorage(savedCategory);
                    requestWakeLock();
                    injectedCounter = false;
                });
            };
        };

        // закончить или продолжить?
        if (document.querySelector("section.result.game__result")) {
            if (document.querySelector("button.result__btn")) {
                selectUniverseResult();
            };
        };

        if (document.querySelector(selector.modalMultiGame)) {
            // автостоп по галактике
            universeHypeTrainInit();

            if (!universeCategoryClickBinded) {
                universeCategoryClickBinded = true;

                // запоминаем категорию вселенной и сбрасываем счетчик при клике на категорию
                $(".modal-multigame__game-card").bind("click", function(){
                    universeStepRunFinished = false;
                    const universeName = $(this).find(".modal-multigame__game-card-title").text().trim();
                    counter = 0;
                    savedUniverseName = universeName;

                    if (!universeHypeTrain) {
                        universeIndex = getUniverseIndexByName(universeName);
                        universeCycled = true;
                        maxCounter = "♾️";
                        log(`Вселенная "${universeName}[${universeIndex}]"`);
                    }
                });
            };
        };

        // жмакаем на белую кнопку продолжить игру
        if (!universeHypeTrain) {
            if (document.querySelector(selector.whitebutton)) {
                const element = $(selector.whitebutton);
                pushNext(element);
            };
        };
    });
};
